import axios from 'axios';
import { tokenHeader } from '../headersauth';
import { reset } from 'redux-form';
import history from '../history';
import { GET_DATAS, GET_DATA, ADD_DATA, DELETE_DATA, EDIT_DATA } from './types';
export const getDATAS = () => async dispatch => {


    const res =await axios.get('/http://localhost:8000/api/project/',tokenHeader());
  dispatch({
    type: GET_DATAS,
    payload: res.DATA
  });
};

// GET DATA
export const getDATA = id => async dispatch => {

    const res =await axios.get(`/http://localhost:8000/api/project/${id}/`,tokenHeader());
  dispatch({
    type: GET_DATA,
    payload: res.DATA
  });
};

// ADD DATA
export const addDATA = formValues => async dispatch => {

  const res = await axios.post('/http://localhost:8000/api/project/', { ...formValues },tokenHeader());
  dispatch({
    type: ADD_DATA,
    payload: res.DATA
  });
  dispatch(reset('DATAForm'));
};

// DELETE DATA
export const deleteDATA = id => async dispatch => {

  await axios.delete(`/http://localhost:8000/api/project/${id}/`,tokenHeader());
  dispatch({
    type: DELETE_DATA,
    payload: id
  });
  history.push('/');
};

// EDIT DATA
export const editDATA = (id, formValues) => async dispatch => {

    const res = await axios.patch(`/http://localhost:8000/api/project/${id}/`, formValues, tokenHeader());
  dispatch({
    type: EDIT_DATA,
    payload: res.DATA
  });
  history.push('/');
};
